import styled from "styled-components";

export const ContactInfoContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 380px;
  letter-spacing: 1px;
`;

export const OwnerLogosContainer = styled.div`
  display: flex;
  justify-content: space-between;

  svg {
    padding: 20px 0px 20px 0px;
    width: 150px;
    height: 150px;
  }
`;
